import React from "react";
import "../../styles/MovieModal.css";

const MovieModal = ({
  backdrop_path,
  title,
  overview,
  name,
  release_date,
  first_air_date,
  vote_average,
  setModal,
}) => {
  return <article className="MovieModal">Modal</article>;
};

export default MovieModal;
